import React, { useState, useEffect } from 'react';
import { getHistory, getHistoryDetail, deleteHistoryEntry } from '../services/api';
import './HistoryPanel.css';

const HistoryPanel = ({ onSelectNote, isOpen, onClose }) => {
  const [history, setHistory] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const loadHistory = async () => {
    setLoading(true);
    setError('');
    try {
      const response = await getHistory();
      setHistory(response.data || []);
    } catch (err) {
      setError('Erro ao carregar hist贸rico');
      console.error('Erro:', err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (isOpen) {
      loadHistory();
    }
  }, [isOpen]);

  const handleViewNote = async (id) => {
    try {
      const response = await getHistoryDetail(id);
      if (response.success && onSelectNote) {
        onSelectNote(response.data);
      }
    } catch (err) {
      setError('Erro ao carregar nota');
      console.error('Erro:', err);
    }
  };

  const handleDeleteNote = async (id, event) => {
    event.stopPropagation();
    
    if (window.confirm('Tem certeza que deseja excluir esta nota do hist贸rico?')) {
      try {
        await deleteHistoryEntry(id);
        setHistory(history.filter(item => item.id !== id));
      } catch (err) {
        setError('Erro ao excluir nota');
        console.error('Erro:', err);
      }
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString('pt-BR');
  };

  const formatCurrency = (value) => {
    return new Intl.NumberFormat('pt-BR', {
      style: 'currency',
      currency: 'BRL'
    }).format(value || 0);
  };

  if (!isOpen) return null;

  return (
    <div className="history-panel-overlay" onClick={onClose}>
      <div className="history-panel" onClick={(e) => e.stopPropagation()}>
        <div className="history-header">
          <h2>Hist贸rico de Notas Fiscais</h2>
          <button className="close-button" onClick={onClose}></button>
        </div>

        {error && (
          <div className="error-message">
            {error}
          </div>
        )}

        {loading ? (
          <div className="loading">Carregando hist贸rico...</div>
        ) : history.length === 0 ? (
          <div className="empty-history">
            <p>Nenhuma nota fiscal processada ainda.</p>
          </div>
        ) : (
          <div className="history-list">
            {history.map((item) => (
              <div 
                key={item.id} 
                className="history-item"
                onClick={() => handleViewNote(item.id)}
              >
                <div className="history-item-content">
                  <div className="history-item-main">
                    <h4>{item.preview.fornecedor || 'Fornecedor n茫o identificado'}</h4>
                    <p className="file-name">{item.fileName}</p>
                    <div className="history-details">
                      <span>NF: {item.preview.numeroNota || 'N/A'}</span>
                      <span>Valor: {formatCurrency(item.preview.valorTotal)}</span>
                      <span>Emiss茫o: {item.preview.dataEmissao || 'N/A'}</span>
                    </div>
                  </div>
                  <div className="history-item-actions">
                    <span className="history-date">{formatDate(item.processedAt)}</span>
                    <button 
                      className="delete-button"
                      onClick={(e) => handleDeleteNote(item.id, e)}
                      title="Excluir do hist贸rico"
                    >
                      锔
                    </button>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}

        <div className="history-footer">
          <p>Total: {history.length} nota(s) processada(s)</p>
        </div>
      </div>
    </div>
  );
};

export default HistoryPanel;
